import Loader from '../components/Loader';

const LoaderOverlay= styled(Loader)`
  ${cover()}
`;

const Home: FC = () => {

  return (
    <>

      <Layout>
        <IntroCard
          name="Ricardo Rodrigues"
          description="Front End Developer"
        />
      </Layout>
    </>
  );
};

export default Home;
